import React from 'react'
import {Icon} from "@material-ui/core";
import ArtworchDark from '../../../../../assets/img/logo_dark.svg'
import ArtworchLight from '../../../../../assets/img/logo_light.svg'
import {Link} from "react-router-dom";
import IconButton from "@material-ui/core/IconButton";



function Logo(props) {
    const {size} = props
    console.log(size.width)

    return (
        <IconButton component={Link} to="/" color='inherit' style={{marginRight: '20px',}}>
            <Icon>
                {
                    props.themeColor === 'dark' ?
                        <img src={ArtworchLight} height={size.height} width={size.width} alt='artworch' /> :
                        <img src={ArtworchDark} height={size.height} width={size.width} alt='artworch' />
                }
            </Icon>
        </IconButton>
    )
}

export default Logo
